import React from 'react';
import './App.css';
import MapContainer from './containers/MapContainer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Map Demo</h1>
      </header>

      <MapContainer />
    </div>
  );
}

export default App;
